import React from "react";

import logo from './assets/nexus.webp';
import Login from "./pages/Login";

function Routes(props) {
    return null;
}

function ToastContainer() {
    return null;
}

function Route(props) {
    return null;
}

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login />} />
      </Routes>
    </Router>
  );
}

export default App;
